import React from "react";

const Navbar = ({ activeTab, onTabChange }) => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light mt-3">
      <div className="container-fluid px-4 mx-4">
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <a className="navbar-brand ms-3" href="#">Doggo</a>
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav mb-2 mb-lg-0">
            <li className={`nav-item ${activeTab === "list" ? "active" : ""}`}>
              <a className="nav-link mx-2" href="#" onClick={() => onTabChange("list")}>List</a>
            </li>
            <li className={`nav-item ${activeTab === "track" ? "active" : ""}`}>
              <a className="nav-link mx-2" href="#" onClick={() => onTabChange("track")}>Track</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
